import React from 'react'
import propTypes from "prop-types";
//import TextFieldGroup from "../common/TextFieldGroup";
import Field from "./common/Field";

const Contact = () => {
  return (
      <div className="register">
        <div className="container">
          <div className="row">
            <div className="col-md-8 m-auto">
              <h1 className="display-4 text-center">S'enregistrer</h1>
              <p className="lead text-center">
                Creer votre compte <span style={{color:"red",frontSize:"20px"}}>Moutabari3</span>
              </p>
              <form noValidate onSubmit={this.onSubmit}>
                <TextFieldGroup
                  placeholder="Nom et Prenom"
                  name="name"
                  value={this.state.name}
                  onChange={this.onChange}
                  error={errors.name}
                />
                <Field
                  placeholder="Email"
                  name="email"
                  type="email"
                  onChange={this.onChange}
                  error={errors.email}
                  info="This site uses Gravatar so if you want a profile image, use a Gravatar email"
                />
                <Field
                  placeholder="Mot de passe"
                  name="password"
                  type="password"
                  onChange={this.onChange}
                  error={errors.password}
                />
                <Field
                  placeholder="Retapez le mot de passe"
                  name="password2"
                  type="password"
                  onChange={this.onChange}
                  error={errors.password2}
                />
                <input
                  type="submit"
                  className="btn btn-info btn-block mt-4"
                  onSubmit={this.onSubmit}
                />
              </form>
              <p className="lead text-center" style={{marginTop:"10px",marginBottom:"20px",fontSize:"15px"}}>
                <Link to="/login" style={{color:"#4AA2B8"}}>j'ai deja un compte</Link>
                </p>
            </div>
          </div>
        </div>
      </div>
    );

}

export default Contact
